import React from "react";
import Styles from "./myCard.module.css";
import VisibilityIcon from "@material-ui/icons/Visibility";
import FavoriteIcon from "@material-ui/icons/Favorite";
import BookmarkBorderIcon from "@material-ui/icons/BookmarkBorder";
import { Badge } from "@material-ui/core";
import { Button } from "react-bootstrap";
export default function myCard(props) {
	const { username, quoteTittle, quote, tag } = props;
	return (
		<div className={Styles.wrapper}>
			<p className={Styles.header}>{tag}</p>
			<h2 className={Styles.h2}>{quoteTittle}</h2>
			<p className={Styles.adjective}>{username}</p>
			<p className={Styles.quote}>{quote}</p>
			<div className={Styles.BottomBar}>
				<Button className={Styles.test}>Learn</Button>
				<Badge badgeContent={4} color="primary">
					<VisibilityIcon style={{ color: "red" }}></VisibilityIcon>
				</Badge>
				<Badge badgeContent={4} color="primary">
					<FavoriteIcon></FavoriteIcon>
				</Badge>
			</div>
		</div>
	);
}
